import './App.css';
import Header from './components/Header';
import User from './components/User';

const friends=[
  {

    name:"Ahmet",
  },
  {
    name:"Tayfun",
  },
  {
    name:"Gokhan",
  },
  {
    name:"Ali",
  },
]

function App() {
  return (
    <div>
      <User 
      name="Mehmet" 
      surname="Seven" 
      isLoggedIn={true} 
      age={29}
      friends={friends}
      />
    </div>
  );
}

export default App;
